  if (!window.dpAppRunner) {

      window.reportProps["appData"] = { data: { result: {"view_xml": "\u003cView version=\"1\" fragment=\"false\"\u003e\u003cSelect type=\"tabs\"\u003e\u003cGroup label=\"Non-atomic MEV\" columns=\"1\" valign=\"top\"\u003e\u003cText\u003e\u003c![CDATA[# \u003cp style=\u0027text-align: center;margin:0px;\u0027\u003e Searcher-Builder Relationship Dashboard \u003c/p\u003e\n\n\u003cdiv\u003e\u003cdiv\u003e\u003cdiv style =\u0027float:left;color:#0F1419;font-size:18px\u0027\u003eBased on transactions from last 14 days. Last updated 2023-09-30 17:20:47.\u003c/div\u003e\u003cdiv style =\"float:right;font-size:18px;color:#0F1419\"\u003eView \u003ca href=\"https://github.com/winnsterx/searcher_database/tree/main/data\"\u003eraw data\u003c/a\u003e \u003c/div\u003e\u003c/div\u003e\u003cdiv\u003e\u003cdiv style =\"float:left;font-size:18px;color:#0F1419;clear: left\"\u003eBuilt by \u003ca href=\"https://twitter.com/winnsterx\"\u003eWinnie\u003c/a\u003e at \u003ca href=\"https://twitter.com/BitwiseInvest\"\u003eBitwise\u003c/a\u003e. Inspired by \u003ca href=\"https://mevboost.pics\"\u003emevboost.pics\u003c/a\u003e.\u003c/div\u003e\u003cdiv style =\"float:right;font-size:18px;color:#0F1419\"\u003eView Source on \u003ca href=\"https://github.com/winnsterx/searcher_database\"\u003eGithub\u003c/a\u003e\u003c/div\u003e\u003c/div\u003e\u003c/div\u003e\u003cbr/\u003e\u003cbr/\u003e\n\n\u003cdiv style=\u0027background-color: white; padding: 2rem; margin-top: 2rem; border-radius: 1rem; border: 3px solid #4c51ff;\u0027\u003e\n    \u003cstrong\u003eNon-atomic MEV\u003c/strong\u003e refers to primarily CEX-DEX arbitrage (\u0026 minimally, cross-chain arbitrage).\u003cbr\u003e\u003cbr\u003e\n    Using \u003ca href=\"https://data.zeromev.org/docs/\" style=\"color: #4c51ff;\"\u003eZeromev API\u003c/a\u003e, we collect all directional swaps and identify non-atomic MEV transactions using these \u003ca href=\"https://github.com/winnsterx/searcherbuilder.pics/blob/e084727a0bf09f990d1aef090a4aef7e3df78b72/nonatomic_mev.py#L19\" style=\"color: #4c51ff;\"\u003eheuristics\u003c/a\u003e. We filter out transactions sent to \u003ca href=\"https://github.com/winnsterx/searcherbuilder.pics/blob/main/labels/non_mev_contracts.py\" style=\"color: #4c51ff;\"\u003eknown non-MEV smart contracts\u003c/a\u003e. Examining the orderflow that non-atomic searchers sent to each builder, we can infer potentially exclusive searcher-builder relationships. We recommend \u003cstrong\u003evolume\u003c/strong\u003e and \u003cstrong\u003ebribe\u003c/strong\u003e as the most reliable metric for non-atomic MEV.\n\u003c/div\u003e]]\u003e\u003c/Text\u003e\u003cPlot type=\"application/vnd.plotly.v1+json\" responsive=\"true\" scale=\"1.0\" src=\"ref://425e8ef89a\"/\u003e\u003cPlot type=\"application/vnd.plotly.v1+json\" responsive=\"true\" scale=\"1.0\" src=\"ref://073e547287\"/\u003e\u003cPlot type=\"application/vnd.plotly.v1+json\" responsive=\"true\" scale=\"1.0\" src=\"ref://2b4216f555\"/\u003e\u003c/Group\u003e\u003cGroup label=\"Atomic MEV\" columns=\"1\" valign=\"top\"\u003e\u003cText\u003e\u003c![CDATA[# \u003cp style=\u0027text-align: center;margin:0px;\u0027\u003e Searcher-Builder Relationship Dashboard \u003c/p\u003e\n\n\u003cdiv\u003e\u003cdiv\u003e\u003cdiv style =\u0027float:left;color:#0F1419;font-size:18px\u0027\u003eBased on transactions from last 14 days. Last updated 2023-09-30 17:20:47.\u003c/div\u003e\u003cdiv style =\"float:right;font-size:18px;color:#0F1419\"\u003eView \u003ca href=\"https://github.com/winnsterx/searcher_database/tree/main/data\"\u003eraw data\u003c/a\u003e \u003c/div\u003e\u003c/div\u003e\u003cdiv\u003e\u003cdiv style =\"float:left;font-size:18px;color:#0F1419;clear: left\"\u003eBuilt by \u003ca href=\"https://twitter.com/winnsterx\"\u003eWinnie\u003c/a\u003e at \u003ca href=\"https://twitter.com/BitwiseInvest\"\u003eBitwise\u003c/a\u003e. Inspired by \u003ca href=\"https://mevboost.pics\"\u003emevboost.pics\u003c/a\u003e.\u003c/div\u003e\u003cdiv style =\"float:right;font-size:18px;color:#0F1419\"\u003eView Source on \u003ca href=\"https://github.com/winnsterx/searcher_database\"\u003eGithub\u003c/a\u003e\u003c/div\u003e\u003c/div\u003e\u003c/div\u003e\u003cbr/\u003e\u003cbr/\u003e\n\n\u003cdiv style=\u0027background-color: white; padding: 2rem; margin-top: 2rem; border-radius: 1rem; border: 3px solid #4c51ff;\u0027\u003e\n    \u003cstrong\u003eAtomic MEV\u003c/strong\u003e refers to \u003cstrong\u003eDEX-DEX arbitrage, sandwiching, and liquidation.\u003c/strong\u003e\u003cbr\u003e\u003cbr\u003e\n    Using \u003ca href=\"https://data.zeromev.org/docs/\" style=\"color: #4c51ff;\"\u003eZeromev API\u003c/a\u003e, we identify DEX-DEX arbitrage, sandwiching, and liquidation transactions. We filter out transactions sent to \u003ca href=\"https://github.com/winnsterx/searcherbuilder.pics/blob/main/labels/non_mev_contracts.py\" style=\"color: #4c51ff;\"\u003eknown non-MEV smart contracts\u003c/a\u003e. Examining the orderflow that atomic searchers sent to each builder, we can infer potentially exclusive searcher-builder relationships. We recommend \u003cstrong\u003etransaction count\u003c/strong\u003e and \u003cstrong\u003ebribe\u003c/strong\u003e as the most reliable metric for atomic MEV.\n\u003c/div\u003e]]\u003e\u003c/Text\u003e\u003cPlot type=\"application/vnd.plotly.v1+json\" responsive=\"true\" scale=\"1.0\" src=\"ref://a80b032526\"/\u003e\u003cPlot type=\"application/vnd.plotly.v1+json\" responsive=\"true\" scale=\"1.0\" src=\"ref://bd581e9e9b\"/\u003e\u003cPlot type=\"application/vnd.plotly.v1+json\" responsive=\"true\" scale=\"1.0\" src=\"ref://a7f5b9f42e\"/\u003e\u003c/Group\u003e\u003c/Select\u003e\u003c/View\u003e", "assets": {"425e8ef89a": {"src": "data:application/vnd.plotly.v1+json;base64,IntcImRhdGFcIjpbe1wiY3VzdG9tZGF0YVwiOltbXCJyc3luYy1idWlsZGVyXCIsXCIyNTcuNktcIixcInZvbFwiXSxbXCJyc3luYy1idWlsZGVyXCIsXCIzLjdNXCIsXCJ2b2xcIl0sW1wicnN5bmMtYnVpbGRlclwiLFwiNjE5LjVLXCIsXCJ2b2xcIl0sW1wicnN5bmMtYnVpbGRlclwiLF
